INSERT INTO `translation` (`translation_id`, `translation_name`, `translation_address`, `translation_description`, `translation_locale`, `real_estate_id`) VALUES
(1, 'Cần bán căn hộ 2 phòng ngủ tại Phước Mỹ, Quận Sơn Trà, Đà Nẵng', 'Đà Nẵng, Quận Sơn Trà, Phước Mỹ', '<p>Cần b&aacute;n căn hộ 2 ph&ograve;ng ngủ tại Phước Mỹ, Quận Sơn Tr&agrave;, Đ&agrave; Nẵng</p><p>Cần b&aacute;n căn hộ diện t&iacute;ch 98 m2 tại Wyndham Soleil Đ&agrave; Nẵng, gồm c&oacute; 2 ph&ograve;ng ngủ V&agrave; 2 ph&ograve;ng tắm nằm tại Phước Mỹ, Quận Sơn Tr&agrave;.<br /><br />Tiện nghi gồm c&oacute;: M&aacute;y lạnh, Khu vực BBQ, CCTV, Nh&acirc;n vi&ecirc;n lễ t&acirc;n, Ph&ograve;ng tập, S&acirc;n vườn, Thư viện, B&atilde;i đậu xe, S&acirc;n chơi, Bảo vệ, Hồ bơi V&agrave; WiFi.</p>', 'vi', 1),
(2, '2 bedroom apartment for sale in Phuoc My, Son Tra District, Da Nang', 'Đà Nẵng, Quận Sơn Trà, Phước Mỹ', '<p>2 bedroom apartment for sale in Phuoc My, Son Tra District, Da Nang<br />Selling an apartment of 98 m2 in Wyndham Soleil Da Nang, including 2 bedrooms and 2 bathrooms located in Phuoc My, Son Tra District.</p><p>Facilities include: Air conditioning, BBQ area, CCTV, Receptionist, Gym, Garden, Library, Parking, Playground, Security, Pool And WiFi.</p>', 'en', 1),
(3, 'Bán nhà riêng hẻm 583 đường 30/4, Phường Hưng Lợi, Quận Ninh Kiều', '583/78/14 đường 30/4, phường Hưng Lợi, quận Ninh Kiều, thành phố Cần Thơ', '<p>B&aacute;n gấp nh&agrave; hẻm 583 đường 30/4, phường Hưng Lợi, View s&ocirc;ng C&aacute;i Răng</p><p>- Nh&agrave; 1 trệt 1 lầu gồm 2 ph&ograve;ng ngủ, 3 ph&ograve;ng vệ sinh</p><p>- Nh&agrave; hướng T&acirc;y Nam, view s&ocirc;ng C&aacute;i Răng, rộng r&atilde;i tho&aacute;ng m&aacute;t</p><p>- Tiện t&iacute;ch xung quanh b&aacute;n k&iacute;nh 2km trở lại l&agrave; trường tiểu học Nguyễn Du, bệnh viện Y học cổ truyền, Chợ Đầu Sấu, Vincom plaza Xu&acirc;n Kh&aacute;nh, Cao đẳng Cần Thơ...đầy đủ tiện &iacute;ch h&agrave;ng, si&ecirc;u thị mini. Đặt biệt view s&ocirc;ng C&aacute;i Răng, nh&igrave;n về hướng cầu C&aacute;i Răng, tầm nh&igrave;n 700m</p><p>- Sổ hồng ri&ecirc;ng ch&iacute;nh chủ</p>', 'vi', 2),
(4, 'House for sale in alley 583 30/4 Street, Hung Loi Ward, Ninh Kieu District', '583/78/14 30/4 Street, Hung Loi Ward, Ninh Kieu District', '<p>Sell alley 583 30/4 street , Hung Loi Ward, Cai Rang River View</p><p>- House 1 ground 1 floor including 2 bedrooms, 3 bathrooms</p><p>- Southwest house, view to Cai Rang river, spacious and airy</p><p>- Facilities around a 2km radius are Nguyen Du Primary School, Traditional Medicine Hospital, Dau Sau Market, Vincom plaza Xuan Khanh, Can Tho College ... fully equipped with goods, mini supermarkets. Especially, Cai Rang river view, looking towards Cai Rang bridge, vision 700m</p><p>- Governmental own red book</p>', 'en', 2),
