(23, 'Cho thuê căn hộ chung cư Đạt Gia đường Cây Keo, phường Tam Phú, quận Thủ Đức', 'Tầng 7, chung cư Đạt Gia, phường Tam Phú, quận Thủ Đức', '<p>Cho thu&ecirc; căn hộ chung cư Đạt Gia đường C&acirc;y Keo, phường Tam Ph&uacute;, quận Thủ Đức</p><p>- Diện t&iacute;ch 50m2 c&oacute; 1 ph&ograve;ng ngủ v&agrave; 1 nh&agrave; vệ sinh. Thuộc tầng 7. Nội thất đầy đủ, Th&iacute;ch hợp cho những cặp vợ chồng trẻ</p><p>- Căn hộ tho&aacute;ng m&aacute;t, sjach sẽ, dọn v&agrave;o ở ngay, vị tr&iacute; mặt tiền đường C&acirc;y Keo. Gần T&ocirc; Ngọc V&acirc;n, Phạn Văn Dong. C&aacute;ch cầu B&igrave;nh Triệu 10 ph&uacute;t, về s&acirc;n bay T&acirc;n Sơn Nhất 15 ph&uacute;t</p><p>- Dễ d&agrave;ng di chuyển đến c&aacute;c khu trung t&acirc;m quận B&igrave;nh Thạnh, quận 9, Ph&uacute; Nhuận, G&ograve; Vấp...T&aacute;c biệt khởi sự n&aacute;o nhiệt, ồn &agrave;o của trung t&acirc;m th&agrave;nh phố, chỉ 10 ph&uacute;t di chuyển trở về với Đạt Gia Residence bạn sẽ cảm nhận được phong c&aacute;ch sống đầy mới mẻ, sang trọng v&agrave; hiện đại.</p><p>- Cho thu&ecirc; 6.5 triệu/th&aacute;ng. Cọc trước 2 th&aacute;ng</p>', 'vi', 15),
(24, 'Dat Gia apartment for rent in Cay Keo street, Tam Phu ward, Thu Duc district', '7th floor, Dat Gia apartment, Tam Phu ward, Thu Duc district', '<p>Dat Gia apartment for rent in Cay Keo street, Tam Phu ward, Thu Duc district</p><p>- Area 50m2 with 1 bedroom and 1 toilet. On 7th floor. Fully furnished, Suitable for young couples</p><p>- Airy apartment, sjach will, move in immediately, the front of Cay Keo street. Near To Ngoc Van, Pham Van Dong. 10 minutes from Binh Trieu bridge, 15 minutes to Tan Son Nhat airport</p><p>- Easy to move to the central areas of Binh Thanh District, District 9, Phu Nhuan, Go Vap ... The special start of the bustle and noise of the city center, only 10 minutes to go back to Dat Gia Residence you will feel a new, luxurious and modern lifestyle.</p>', 'en', 15),
(25, 'Bán biệt thự riêng hẻm 69 đường 30/4 quận Ninh Kiều, Cần Thơ', '69/78/17 đường 30/4, phường Hưng Lợi, quận Ninh Kiều, thành phố Cần Thơ', '<p>B&aacute;n biệt thự ri&ecirc;ng hẻm 69 đường 30/4, phường Hưng Lợi,&nbsp;quận Ninh Kiều, Cần Thơ - Hướng T&acirc;y Nam</p><p>- Diện t&iacute;ch 120m2 gồm 1 ph&ograve;ng kh&aacute;ch, 3 ph&ograve;ng ngủ, 3 ph&ograve;ng tắm, c&oacute; chỗ đỗ &ocirc; t&ocirc;, s&acirc;n vườn, nội thất đầy đủ</p><p>- Tiện &iacute;ch xung quanh: gần Đại học Cần Thơ, bệnh viện, ng&acirc;n h&agrave;ng, si&ecirc;u thị mini, bưu điện, ph&iacute;a sau view s&ocirc;ng Cần Thơ</p><p>- Khu vực an tĩnh, gio th&ocirc;ng thuận lợi di chuyển đến c&aacute;c khu vực xung quanh</p>', 'vi', 18),
(26, 'Sell private villa alley 69 road 30/4 in Ninh Kieu district, Can Tho', '69/78/17 Street 30/4, Hung Loi Ward, Ninh Kieu District, Can Tho City', '<p>Sell private villa alley 69 30/4 Street, Hung Loi Ward, Ninh Kieu District, Can Tho - Southwest</p><p>- Area 120m2 including 1 living room, 3 bedrooms, 3 bathrooms, parking, garden, fully furnished</p><p>- Utilities: near Can Tho University, hospitals, banks, mini supermarkets, post offices, behind the view of Can Tho river</p><p>- Quiet area, convenient transportation to surrounding areas</p>', 'en', 18),
(27, 'Bán nhà mặt tiền đường 12m Phường Phước Bình, Quận 9. Khu dân cư an ninh. Sổ hồn', 'Phường Phước Bình, Quận 9, TPHCM', '<p>B&aacute;n gấp nh&agrave; phố mặt tiền đường 12m, Phường Phước B&igrave;nh, Quận 9,&nbsp;<strong>View S&ocirc;ng Rạch Chiếc</strong></p><p><strong>- Diện t&iacute;ch đất&nbsp;thực tế: 4.28mx5.11m = 21.4m2,&nbsp;c&ocirc;ng nhận: 4.28mx3.04m = 12.5m2, nh&agrave; 1 trệt 2 lầu, DTSD: 60.6m2, DTSD c&ocirc;ng nhận 25m2, gồm 3 ph&ograve;ng ngủ, 2 ph&ograve;ng vệ sinh.</strong></p><p>- Vị tr&iacute;:&nbsp;<strong>mặt tiền đường nội bộ 10m, dự ph&oacute;ng 12m, xe &ocirc; t&ocirc; ra v&agrave;o thoải m&aacute;i.</strong></p><p>- Nh&agrave; Hướng T&acirc;y Bắc, ph&ugrave; hợp kinh doanh, đầu tư<strong>, Ven song Rạch Chiếc,&nbsp;</strong>rộng r&atilde;i tho&aacute;ng m&aacute;t.&nbsp;<strong>Nh&agrave; đang cho thu&ecirc; 6,5 triệu/ th&aacute;ng</strong></p><p><strong>- Dễ d&agrave;ng di chuyển qua Trung T&acirc;m như Quận 2, Thủ Đức</strong>&nbsp;qua c&aacute;c tuyến đường T&acirc;y H&ograve;a, Đỗ Xu&acirc;n Hợp, Xa Lộ H&agrave; Nội,</p><p>- Tiện &iacute;ch xung quanh: B&aacute;n k&iacute;nh 1km trở lại l&agrave;&nbsp;<strong>Tiểu học Phước B&igrave;nh, THCS Phước B&igrave;nh, Chợ Phước B&igrave;nh, Phim trường BHD, CĐ kinh tế đối ngoại, Cao đẳng c&ocirc;ng nghệ II, Cao Đẳng Nghề Suleco, THPT Phước Long</strong>,&hellip; đầy đủ tiện &iacute;ch ng&acirc;n h&agrave;ng, si&ecirc;u thị mini. Đặt biệt vị tr&iacute; view song Rạch chiếc, nh&igrave;n về Trung T&acirc;m Thể Dục Thể Thao Rạch Chiếc (tương lại) tầm nh&igrave;n 900m.</p><p><strong>- Sổ hồng ri&ecirc;ng ch&iacute;nh chủ.</strong></p>', 'vi', 19),
(28, 'House for sale in front of street 12m, Phuoc Binh Ward, District 9. Secure resid', 'Phuoc Binh Ward, District 9, Ho Chi Minh City', '<p>Selling townhouses front street 12m, Phuoc Binh Ward, District 9, Rach Chiec River View<br />- Actual land area: 4.28mx5.11m = 21.4m2, recognition: 4.28mx3.04m = 12.5m2, house of 1 ground floor 2 floors, DTSD: 60.6m2, DTSD recognized 25m2, including 3 bedrooms, 2 bathrooms born.<br />- Location: 10m internal road frontage, 12m projected, cars in and out comfortably.<br />- Northwestern house, suitable for business, investment, Ven Song Rach Chiec, spacious and airy. The house is renting 6.5 million / month<br />- Easy to move through the Center such as District 2, Thu Duc through the roads of Tay Hoa, Do Xuan Hop, Hanoi Highway,<br />- Surrounding facilities: The radius of 1km back is Phuoc Binh Primary School, Phuoc Binh Secondary School, Cho Phuoc Binh, BHD Film Studio, College of Foreign Economic Relations, College of Technology II, Suleco Vocational College, Phuoc Long High School, ... full banking utility, mini supermarket. Especially the view position of Rach Chiec river, view of Rach Chiec Sports Center (future) with a view of 900m.<br />- Governmental own red book.</p>', 'en', 19);
